webpackJsonp([0xdfa75291c5ac],{445:function(a,e){a.exports={data:{site:{siteMetadata:{title:"しれせせ",author:"shiresese"}},markdownRemark:{id:"/Users/kmac/Documents/srss/shiresese.github.io/src/pages/posts/c93/index.md absPath of file >>> MarkdownRemark",html:'<p>遅くなりましたが、C93 の情報です。<br>「しれせせ」は1日目の <strong>2017/12/29(金曜日) 「サ12b」</strong> にスペースをいただいております。</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 98.74100719424462%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="jacket"\n        title=""\n        src="/static/jacket-2059c8ddeeea7d3de8d30f1d48edce6d-a408b.png"\n        srcset="/static/jacket-2059c8ddeeea7d3de8d30f1d48edce6d-4eabf.png 148w,\n/static/jacket-2059c8ddeeea7d3de8d30f1d48edce6d-5a375.png 295w,\n/static/jacket-2059c8ddeeea7d3de8d30f1d48edce6d-a408b.png 590w,\n/static/jacket-2059c8ddeeea7d3de8d30f1d48edce6d-9a0cc.png 885w,\n/static/jacket-2059c8ddeeea7d3de8d30f1d48edce6d-aa987.png 1180w,\n/static/jacket-2059c8ddeeea7d3de8d30f1d48edce6d-b77b8.png 1668w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  <br>新刊は、『未完成の「ねがいごと」 01.サイドヒラカレルハコノ』オリジナルサウンドトラック 「正義のヒーローは、 きっと私を救ってくれない。」になります。<br>その名の通り、夏に頒布した未完成の「ねがいごと」一作目の BGM &#x26; 主題歌が全部入ったCDです。</p>\n<p>今回、CDの中身だけでなく、外見にも力を入れまして、<br>なんとジャケット8Pフルカラーにイラストを載せた(無駄に)豪華な仕様になっております。</p>\n<p>そのせいで本編より高い謎の逆転現象が起こっていますが、コレクターアイテム的な感じで一つ、よろしくお願いします。</p>\n<p>また、既刊のゲーム本編についても持っていきますので、まだ入手していない方は、サントラと合わせてそちらもどうぞ。</p>\n<hr>\n<p>未完成の「ねがいごと」02 については、申し訳ありません、製作が間に合いませんでした。<br>スタッフ二人でちまちま作っているので、夏→冬の短スパンでは一本完成させるのは厳しいっぽいです。世知辛い。</p>\n<p>しかしながら、来年の夏までには完成させられると思いますので、それまでこのCDを聞きながらお待ちいただければ幸いです。</p>\n<p>それではC93&#x26;それ以降もサークル「しれせせ」をよろしくお願いいたします。</p>',frontmatter:{title:"C93",date:"2017/12/24"}}},pathContext:{slug:"/posts/c93/"}}}});
